import { FunctionComponent, useMemo, type CSSProperties } from "react";
import styles from "./Component.module.css";

export type ComponentType = {
  className?: string;
  cards?: string;

  /** Style props */
  propFlex?: CSSProperties["flex"];
  propMinWidth?: CSSProperties["minWidth"];
};

const Component: FunctionComponent<ComponentType> = ({
  className = "",
  propFlex,
  cards,
  propMinWidth,
}) => {
  const component7Style: CSSProperties = useMemo(() => {
    return {
      flex: propFlex,
    };
  }, [propFlex]);

  const cardsStyle: CSSProperties = useMemo(() => {
    return {
      minWidth: propMinWidth,
    };
  }, [propMinWidth]);

  return (
    <div
      className={[styles.component7, className].join(" ")}
      style={component7Style}
    >
      <a className={styles.cards} style={cardsStyle}>
        {cards}
      </a>
    </div>
  );
};

export default Component;
